def insert_element(lst, element):
    """"""
    index = 0
    for i in range(len(lst)):
        if lst[i] > element:
            break
        index = i + 1
    last_index = None
    for i in range(len(lst) - 1, -1, -1):
        if lst[i] == element:
            last_index = i
            break
    if last_index is not None:
        lst.insert(last_index + 1, element)
    else:
        lst.insert(index, element)
    return lst
